(104, 1, '2022-08-16 14:13:40', '2022-08-16 14:13:40', '<style>/*! elementor - v3.7.2 - 21-08-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Hello!</h2>		\n			<h2>My name is Nemanja Todorovic</h2>		\n					I am a \n				<noscript>\n					WordPress Expert, Web Designer				</noscript>\n					 ...\n			<!-- close .eael-fancy-text-container -->\n			<style>/*! elementor - v3.7.2 - 21-08-2022 */\nbody.elementor-page .elementor-widget-menu-anchor{margin-bottom:0}</style>		\n			<h2>ABOUT ME</h2>		\n			<h2>ABOUT ME</h2>		\n			<style>\nbody{\n    --speed: 10s;\n}\n.sliding-text .elementor-widget-wrap{\n    display: block !important;\n}\n.sliding-text .elementor-widget{\n    overflow: hidden;\n    width: 10000vw !important;\n    max-width: 10000vw !important;\n}\n.sliding-text .sliding .elementor-widget-container{\n    -webkit-animation: sliding var(--speed) linear infinite;\n    -moz-animation: sliding var(--speed) linear infinite;\n    -o-animation: sliding var(--speed) linear infinite;\n    animation: sliding var(--speed) linear infinite;\n}\n.sliding-text .elementor-widget-container{\n    float: left;\n}\n.sliding-text.reverse .elementor-widget-wrap{\n    transform: rotate(180deg);\n}\n.sliding-text.reverse .sliding .elementor-heading-title{\n    transform: scale(-1, -1);\n}\n@keyframe sliding{\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-webkit-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-moz-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-o-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n</style>\n			<style>/*! elementor - v3.7.2 - 21-08-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"500\" height=\"500\" src=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/slicica-za-about.png\" alt=\"\" loading=\"lazy\" srcset=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/slicica-za-about.png 500w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/slicica-za-about-300x300.png 300w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/slicica-za-about-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" />															\n		<p>Hello there,</p><p>In my journey as a WordPress Expert, I started from IT Bootcamp, curiosity about the websites and my obsession with everything related to innovation and design was the key that brought me here.</p><p>Passionate about creating websites with a focus on design, motion, and interaction.</p><p>I love minimalism, brutalism, coffee, and photography.</p><p>Get to know me!</p>		\n			<a href=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/NemanjaTodorovicCV.pdf\" target=\"_blank\" role=\"button\" rel=\"noopener\">\n						Biography\n					</a>\n							<a href=\"https://www.linkedin.com/in/neca2910/\" target=\"_blank\" rel=\"noopener\">\n									</a>\n								<a href=\"https://github.com/TodorNem\" target=\"_blank\" rel=\"noopener\">\n									</a>\n			<h2>PROJECTS</h2>		\n			<h2>PROJECTS</h2>		\n			<style>\nbody{\n    --speed: 1s;\n}\n.sliding-text .elementor-widget-wrap{\n    display: block !important;\n}\n.sliding-text .elementor-widget{\n    overflow: hidden;\n    width: 10000vw !important;\n    max-width: 10000vw !important;\n}\n.sliding-text .sliding .elementor-widget-container{\n    -webkit-animation: sliding var(--speed) linear infinite;\n    -moz-animation: sliding var(--speed) linear infinite;\n    -o-animation: sliding var(--speed) linear infinite;\n    animation: sliding var(--speed) linear infinite;\n}\n.sliding-text .elementor-widget-container{\n    float: left;\n}\n.sliding-text.reverse .elementor-widget-wrap{\n    transform: rotate(180deg);\n}\n.sliding-text.reverse .sliding .elementor-heading-title{\n    transform: scale(-1, -1);\n}\n@keyframe sliding{\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-webkit-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-moz-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-o-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n</style>\n			<h2>Some opportunities and projects that I’m proud of!</h2>		\n            <article data-id=\"414\">\n            <a href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/nuenofashion/\"></a>\n                <img width=\"768\" height=\"373\" src=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt1-768x373.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt1-768x373.jpg 768w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt1-300x146.jpg 300w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt1-1024x497.jpg 1024w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt1.jpg 1338w\" sizes=\"(max-width: 768px) 100vw, 768px\" />\n        <header><h2><a\n                        href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/nuenofashion/\"\n                        title=\"NUENO/ digital fashion\">NUENO/ digital fashion</a></h2></header>\n    </article><article data-id=\"398\">\n            <a href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/leomouraire/\"></a>\n                <img width=\"768\" height=\"368\" src=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt2-768x368.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt2-768x368.jpg 768w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt2-300x144.jpg 300w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt2-1024x490.jpg 1024w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt2.jpg 1341w\" sizes=\"(max-width: 768px) 100vw, 768px\" />\n        <header><h2><a\n                        href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/leomouraire/\"\n                        title=\"Leo Mouraire\">Leo Mouraire</a></h2></header>\n    </article><article data-id=\"396\">\n            <a href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/peoplenerds/\"></a>\n                <img width=\"768\" height=\"359\" src=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt3-768x359.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt3-768x359.jpg 768w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt3-300x140.jpg 300w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt3-1024x479.jpg 1024w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/sajt3.jpg 1349w\" sizes=\"(max-width: 768px) 100vw, 768px\" />\n        <header><h2><a\n                        href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/peoplenerds/\"\n                        title=\"People Nerds\">People Nerds</a></h2></header>\n    </article><article data-id=\"377\">\n            <a href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/digitel/\"></a>\n                <img width=\"768\" height=\"351\" src=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1-768x351.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1-768x351.jpg 768w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1-300x137.jpg 300w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1-1024x468.jpg 1024w, https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1.jpg 1343w\" sizes=\"(max-width: 768px) 100vw, 768px\" />\n        <header><h2><a\n                        href=\"https://ntodorovic.wppsbootcamp.com/portfolio/projects/digitel/\"\n                        title=\"Digitel\">Digitel</a></h2></header>\n    </article>\n				<h2>Motivated by empathy devoted to creativity</h2>\n				<p>I’m here to ask the necessary (and sometimes difficult questions) to create websites and products that focus on and prioritize people.</p><p>With 6 years of experience, I\'ve collectively worked on both the agency and client-side of the fence, here in Serbia and overseas. Earning a reputation for consistently delivering impactful and creative solutions, I\'ve led major websites and digital projects for clients.</p>\n			<h2>SERVICES</h2>		\n			<h2>SERVICES</h2>		\n			<style>\nbody{\n    --speed: 10s;\n}\n.sliding-text .elementor-widget-wrap{\n    display: block !important;\n}\n.sliding-text .elementor-widget{\n    overflow: hidden;\n    width: 10000vw !important;\n    max-width: 10000vw !important;\n}\n.sliding-text .sliding .elementor-widget-container{\n    -webkit-animation: sliding var(--speed) linear infinite;\n    -moz-animation: sliding var(--speed) linear infinite;\n    -o-animation: sliding var(--speed) linear infinite;\n    animation: sliding var(--speed) linear infinite;\n}\n.sliding-text .elementor-widget-container{\n    float: left;\n}\n.sliding-text.reverse .elementor-widget-wrap{\n    transform: rotate(180deg);\n}\n.sliding-text.reverse .sliding .elementor-heading-title{\n    transform: scale(-1, -1);\n}\n@keyframe sliding{\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-webkit-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-moz-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@-o-keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n@keyframes sliding {\n0%{ transform: translateX(0); }\n100%{ transform: translateX(-100%); }\n}\n</style>\n		<p>I\'m always looking for new opportunities and WordPress projects to take on. However, I completely understand that finding the right expert for your project can sometimes feel like a steep task. Here are a few more details about the services I offer to help you get to know me better and figure out if I\'m the right fit for your project!</p>		\n			&nbsp;		\n			<h2>Creating websites</h2>		\n			        <link-hover>\n            <a href=\"#websites\"   rel=\"nofollow\">\n                View more\n            </a>\n        </link-hover>		\n			&nbsp;		\n			<h2>PERFORMANCE</h2>		\n			        <link-hover>\n            <a href=\"#performance\"   rel=\"nofollow\">\n                View more\n            </a>\n        </link-hover>		\n			&nbsp;		\n			<h2>Troubleshooting</h2>		\n			        <link-hover>\n            <a href=\"#troubleshooting\"   rel=\"nofollow\">\n                View more\n            </a>\n        </link-hover>		\n			&nbsp;		\n			<h2>dESIGN</h2>		\n			        <link-hover>\n            <a href=\"#design\"   rel=\"nofollow\">\n                View more\n            </a>\n        </link-hover>		\n			&nbsp;		\n			<h2>E-COMMERCE</h2>		\n			        <link-hover>\n            <a href=\"#ecommerce\"   rel=\"nofollow\">\n                View more\n            </a>\n        </link-hover>		\n			<h2>Creating Websites</h2>		\n			<h2>Should I create a website?</h2>		\n		<p>Every website is a reflection of an idea. Making a website is common but making a website with a new idea is what makes it exceptional. If you get a website that helps you solve real-life problems then that will be a great idea. <br />All-in-all, there are many reasons to create a website.<br />Whether you want to generate more leads for your local business online, sell products in an e-commerce store, or build an online presence for yourself – a website can be a great idea.<br />In fact, there aren’t very many reasons not to create a website.<br />However, whether you decide to build a website for yourself or not, I hope I will help you answer your question.</p>		\n			&nbsp;		\n			<h2>Performance</h2>		\n			<h2>Monitoring and improving website performance by using optimization best practices. </h2>		\n		There are many reasons that ring alarm bells, some of which might even cause major concerns for you:\nSearch engines (like Google) rank websites with fast-loading times higher than the slow-loading ones. So, if you want to improve your position in the SERPs, improving the performance of your WordPress site should be one of your priorities.\nStudies have shown that site-loading speed of more than 2 seconds usually results in about 47 percent of visitors bouncing off the website. So, to keep about half of your visitors interested, you should speed up your WordPress.\nOnline buyers are the most impatient lot; they expect the page to load within a second. So, if you are running an e-commerce store on WordPress then you better get ready to make major improvements so your business can be more profitable.		\n			&nbsp;		\n			<h2>Troubleshooting</h2>		\n			<h2>Troubleshooting WordPress issues (error 500, 404, mixed content, layout issues, plugin or theme conflict)</h2>		\n		<p>Troubleshoot your WordPress website, fix WordPress website issues and errors, WordPress website design and revamp the website, WordPress plugin conflict, Fix WP Themes and Plugin Issues, Fix WP Memory Errors, PHP memory limit, Error Establishing A Database Connection, WP Internal Server Errors,HTTP Error 403 – Forbidden, Woocommerce error, Payment Gateway, Woocommerce Products images not showing, Broken or white screen issue, WordPress speed, Html/CSS issues, Header changes, Menu and mega-menu error and Fixing layout problems.</p>		\n			&nbsp;		\n			<h2>Design</h2>		\n			<h2>Creating well-designed, responsive WordPress websites by utilizing Page Builders and corresponding plugins</h2>		\n		Following the principles of website design can make or break your site’s success. It’s the difference between users leaving almost as soon as they hit your homepage, or exploring your services and products and eventually converting.\nDesign is by no means an exact science. However, there are many useful principles and rules-of-thumb that can help make your projects better in terms of both usability and aesthetics when looking to build a professional website.		\n			&nbsp;		\n			<h2>E-commerce</h2>		\n			<h2>Setting up a WordPress e-commerce platform, including Shop, custom templates, and payment gateway configuration</h2>		\n		E-commerce is much more than buying and selling online, although they represent a large part of its use and are by far the most associated with it. Therefore, in addition to trade, e-commerce also includes the following: business to consumer B2C,\nbusiness to business B2B,\nconsumer to business C2B,\nconsumer to consumer C2C,\ndirect to consumer D2C,\ndropshipping,\nsubscription services,\ninternet banking,\nonline ticket sales...\nThis list continues and expands daily. Given the range of products and services it involves, e-commerce is an integral part of daily activities for a significant portion of the world\'s population, either from a professional or private perspective – or both.		\n			&nbsp;		\n				<h2>LET&#039;S GET YOUR BUSINESS</h2>\n				<h2>WHERE YOU WANT IT TO BE</h2>\n			<h2>Have an idea?</h2>		\n			<h2>Make magic with me ...</h2>		\n			&nbsp;		\n		I’m not really active on <a href=\"https://codepen.io/todor_N\" target=\"_blank\" rel=\"noopener\">CodePen</a> but you can stay in touch with me on <a href=\"https://www.linkedin.com/in/neca2910/\" target=\"_blank\" rel=\"noopener\">Linkedin</a>. I post some of my work on <a href=\"https://www.instagram.com/todor__n/&quot;\" target=\"_blank\" rel=\"noopener\">Instagram</a> and some experiments on <a href=\"https://dribbble.com/TodorN\" target=\"_blank\" rel=\"noopener\">Dribble</a>.		\n			[contact-form-7 id=\"8\" title=\"Contact form 1\"]', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2022-08-24 18:42:59', '2022-08-24 18:42:59', '', 0, 'https://ntodorovic.wppsbootcamp.com/portfolio/?page_id=104', 0, 'page', '', 0),
(377, 1, '2022-08-17 09:10:23', '2022-08-17 09:10:23', '<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Modern website with Woocommerce.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">What I did do for this site?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">Custom built to specific needs</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Your business needs more than a generic theme with minor customization. Off-the-rack themes are bloated with features you don’t need.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">Minimal plugins</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Plugins are easy to install but hard to remove. Websites with dozens of plugins can become a house of cards – you don’t know what will happen if you deactivate one. I use industry-standard plugins when they make sense (like a contact form), and build your unique functionality from scratch.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">As easy to edit as a Word document</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">The purpose of a CMS is to let you manage content yourself, without the need for a developer. I focus on crafting the backend editing experience to be as easy to use as the frontend.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">Faster than competitors</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">A 0.1-second improvement of mobile site speed can increase conversion rates by 8-10%. I can deliver speed and efficiency no off-the-shelf theme can match.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">Accessible to all users</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">15% of visitors experience some level of disability, and accessibility lawsuits are increasing. I build websites that meet the Web Content Accessibility Guidelines (WCAG) 2.1 standards.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"ast-global-color-8\"} -->\n<h3 class=\"has-ast-global-color-8-color has-text-color\">Built to last</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">The web changes fast, but you don’t need a new website every few years. I can build you a solid foundation that will adapt to your future needs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://ntodorovic.wppsbootcamp.com/digitel/\">https://ntodorovic.wppsbootcamp.com/digitel/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://ntodorovic.wppsbootcamp.com/digitel/\" target=\"_blank\" rel=\"noreferrer noopener\">See more</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->', 'Digitel', '', 'publish', 'closed', 'closed', '', 'digitel', '', '', '2022-08-19 14:16:18', '2022-08-19 14:16:18', '', 0, 'https://ntodorovic.wppsbootcamp.com/portfolio/?post_type=projects&#038;p=377', 0, 'projects', '', 0),
(378, 1, '2022-08-17 09:10:16', '2022-08-17 09:10:16', '', 'Screenshot_1', '', 'inherit', 'open', 'closed', '', 'screenshot_1', '', '', '2022-08-17 09:10:16', '2022-08-17 09:10:16', '', 377, 'https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1.jpg', 0, 'attachment', 'image/jpeg', 0),
(396, 1, '2022-08-17 09:29:07', '2022-08-17 09:29:07', '<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">This Event website contacted me because they were looking for a freelance WordPress expert to create a  website for them. They were using a DIY website builder but wanted to have more control over their website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">As an on-location event speaker, they provide services to clients in Rome, Italy, and all over the world. They needed a&nbsp;WordPress&nbsp;website that they could edit easily to showcase their portfolio as a freelancer and promote their services worldwide.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">WordPress was a perfect solution to build a website portfolio to showcase their work and add to their blog regularly. They did not want to start with an event  WordPress theme because they didn\'t want their site to look like so many others. So we reviewed professional WordPress themes and customized one to meet their needs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Along with web development, they needed web design and hosting so I put together a&nbsp;small business website package for them that included design and development along with web hosting, domain management, and ongoing&nbsp;WordPress maintenance&nbsp;to keep their site secure. We have also worked on SEO to improve their search engine rankings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">If you need help building a professional WordPress website that you can manage on your own,&nbsp;contact me.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://peoplenerdsconf.dscout.com/\">https://peoplenerdsconf.dscout.com/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://peoplenerdsconf.dscout.com/#about\" target=\"_blank\" rel=\"noreferrer noopener\">See more</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->', 'People Nerds', '', 'publish', 'closed', 'closed', '', 'peoplenerds', '', '', '2022-08-19 14:33:01', '2022-08-19 14:33:01', '', 0, 'https://ntodorovic.wppsbootcamp.com/portfolio/?post_type=projects&#038;p=396', 0, 'projects', '', 0),
(398, 1, '2022-08-17 09:32:41', '2022-08-17 09:32:41', '<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Creative developer, 2020-2022 projects</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Leo Mouraire is a France creative back-end developer that helps organizations attract, retain and manage talented people. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">My mission was to design him a new brand and WordPress website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">After talking to the client and considering the target market, it was clear to me that we needed to create a very traditional, high-end brand aesthetic. I experimented with rectangular shapes and sharp straight lines for the logo symbol (above left), but in the end, we decided to go with a purely typographical logo design (above right). The simple black color scheme conveys strength and trust.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">I worked with the client to figure out the website structure and content. The sitemap (above&nbsp;left) was purposely kept small and shallow to ensure that the website could be quickly and easily navigated. I sketched out some initial concepts and wireframes (above&nbsp;right) and discussed them with the client to ensure that we were both on the same page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">The main aim was to create a brochure website that showcased the service offering. Once the client was happy with the initial direction, I moved into WordPress to put some concepts together based on the brand and initial sketches. The homepage below is centered around an image slider with the main website sections positioned underneath. The content page below that has a similar layout with a strong focus on the content.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Some design challenges are harder than others, but when you have a great client to work with, it makes it that much easier to achieve your objective. I had a great time working with this client and I’m glad that I could help them create a brand and website that met their company needs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://leomouraire.com/\">https://leomouraire.com/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://leomouraire.com/\" target=\"_blank\" rel=\"noreferrer noopener\">View live</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->', 'Leo Mouraire', '', 'publish', 'closed', 'closed', '', 'leomouraire', '', '', '2022-08-19 14:05:06', '2022-08-19 14:05:06', '', 0, 'https://ntodorovic.wppsbootcamp.com/portfolio/?post_type=projects&#038;p=398', 0, 'projects', '', 0),
(401, 1, '2022-08-17 09:38:11', '2022-08-17 09:38:11', '', 'Screenshot_1', '', 'inherit', 'open', 'closed', '', 'screenshot_1-2', '', '', '2022-08-17 09:38:11', '2022-08-17 09:38:11', '', 377, 'https://ntodorovic.wppsbootcamp.com/portfolio/wp-content/uploads/2022/08/Screenshot_1-1.jpg', 0, 'attachment', 'image/jpeg', 0),
(414, 1, '2022-08-17 09:50:39', '2022-08-17 09:50:39', '<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">The Nueno  homepage was in need of some love, so I gave it a cosmetic facelift. This case study shows that visual design alone can have a huge impact on the UX of a web page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">The Nueno homepage hadn’t been updated in a while and there were a bunch of known customer pain points which needed to be addressed. Our goal was to improve the user experience and modernize the aesthetic. The tricky part was that there wasn’t scope for a back-end rebuild, so we had to work with what was already there and change the front end into something new. The design didn’t need to be responsive as there is a separate mobile site.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Looking at the old homepage above, it’s clear that the goal was to fit everything above the fold. I suspect that it may have been a business or marketing requirement at the time. Somehow, the designer of the page managed to do it, which is actually pretty impressive. It must have been tricky as there are quite a few elements to fit on the page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Because everything is above the fold, however, the page is quite busy and cluttered, making it difficult for users to find what they’re looking for. We used insights from analytics and user feedback on the old Nueno homepage to help inform the new design.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\",\"fontSize\":\"medium\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color has-medium-font-size\">About Nueno digital fashion</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Nueno digital fashion is a project where digital merges with reality. Check out the digital streetwear jacket and the minimalistic coat that doesn\'t physically exist though it is presented by a professional model. It\'s the very first time when models and photographers work on a photo shoot with physically non-existent outfits.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">In this project, I wanted to answer on following questions :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">THE CLOTHES THAT DON\'T EXIST!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">What is Digital Fashion?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Hot to get closer to customers?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"ast-global-color-8\"} -->\n<p class=\"has-ast-global-color-8-color has-text-color\">Ar used by fashion brands?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://nuenofashion.com/\">https://nuenofashion.com/</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://nuenofashion.com/\" target=\"_blank\" rel=\"noreferrer noopener\">See more</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->', 'NUENO/ digital fashion', '', 'publish', 'closed', 'closed', '', 'nuenofashion', '', '', '2022-08-19 13:58:49', '2022-08-19 13:58:49', '', 0, 'https://ntodorovic.wppsbootcamp.com/portfolio/?post_type=projects&#038;p=414', 0, 'projects', '', 0),
